import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
  button: {
    backgroundColor: "purple",
    width: 120,
    height: 90,
    borderRadius: 10,
    borderWidth: 2,
    borderColor: 'blueviolet',
  },
  text: {
    color: "#8a2be2",
    fontSize: 17,
    marginTop: "25%",
    textAlign: "center",
    fontWeight: 'bold'
  }
});

export default styles;
